import React from 'react';
import Axios from 'axios';

export const createDoctor = async (doctor) => {

  let res = await Axios.get(
    `http://localhost:3000/geocodes/details/${doctor.id}`
  );
  const detailedDoctor = JSON.parse(res);
  const {
    place_id,
    name,
    address,
    opening_hours,
    rating,
    user_ratings_total,
    phone,
    geometry: {
      location: { lat, lng },
    },
  } = detailedDoctor;

  const doctorHash = {
    place_id,
    name,
    address,
    opening_hours,
    rating,
    user_ratings_total,
    phone,
    lat,
    lng,
  };
  debugger

  return doctorHash;
};
